    false,nt"url": null,nt"notes": "This annual narrative report for Flint
    Hills National Wildlife Refuge summarizes refuge activities during the 1993 calendar
    year.  The report begins with a summary of the yearu2019s highlights and climatic
    conditions.  The report includes a planning section which discusses management plans,
    compliance with environmental and cultural resource mandates, and research and investigations.
     Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, safety, and other items is given.  Habitat management
    is also covered.  Subjects include general, wetlands, forests, cropland, grassland,
    haying, fire management, pest control, and water rights.  The wildlife section of
    the report discusses general, endangered and/or threatened species, waterfowl, marsh
    and water birds, shorebirds, gulls, terns and allied species, raptors, other migratory
    species, other resident wildlife, fisheries resources, and scientific collections.
     The public uses of the refuge described in this report include general, student
    outdoor classrooms, interpretive foot trails, interpretive exhibits and demonstrations,
    hunting, fishing, trapping, wildlife observation, other wildlife oriented recreation,
    picnicking, and other non-wildlife oriented recreation.  The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    equipment utilization and replacement, communications systems, computer systems.
     Items of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
